import React from "react"
import Header from "./Components/Header"

export default function App(){

  fetch('https://api.themoviedb.org/3/search/movie?api_key=ba0ac7475d9d6eef735d172d922bea03&language=en-US&query=game')
  .then((response) => {
    return response.json();
  })
  .then((myJson) => {
    console.log(myJson);
  });



  return (
      <div>
        <Header />
      </div>
  )
}
